import dynamic from 'next/dynamic';

const DynamicComponent = dynamic(() => import('../components/index'));

function HiThere() {
  return (
    <div>
      <Header />
      <DynamicComponent />
      <p>HOME PAGE is here!</p>
    </div>
  );
}

export default HiThere;
